Meaning;

Aimed toward all the jazz connoisseurs out in the world young or old, this design is perfect for showing others your music of choice. This design works with all types of jazz, and is meant to promote this beautiful and incredible musical style.

PLEASE NOTE : Our current run of sweaters (crewneck and pullover hoodies) run slightly larger. We recommend that you choose one size smaller than you usually are. For example, if you’re an X-Large, please choose a Large, if you’re a Large please choose a Medium, and so on…
